import React from "react"

function Recipieslist(props){ 

    const {recipeList} = props
    console.log(recipeList)

    return ( 
        <div> 
            {recipeList.map((item) => 
            <>
                <h1>{item.title}</h1>
                <img alt = "image not found" src ={`https://spoonacular.com/recipeImages/${item.id}-{SIZE}${item.image.toString()}`}></img>
                <h4>Ready in{item.readyInMinutes}</h4>
                <h4>Serves {item.servings}</h4>
            </>
                )}

        </div>
    )
}

export default Recipieslist
